import { ProductProps } from "components/Product/types";
import Text from "components/Text/Text";
import { Card, Image } from "react-bootstrap";

import {
	CardProductImage,
	CardTitle,
	ProductLink,
} from "components/Product/ProductStyled";
import { CardProductBody } from "components/Product/ProductStyled";

const Product = ({ product }: ProductProps): any => {
	return (
		<Card className='my-3 p-3 rounded'>
			<ProductLink href={`/product/${product.vendorСode}`}>
				<Image src={product.image} alt={product.name} fluid />
			</ProductLink>

			<Card.Body>
				<ProductLink href={`/product/${product.vendorСode}`}>
					<Card.Title as='div'>
						<Text variant='p2'>{product.name}</Text>
					</Card.Title>
				</ProductLink>

				<Text variant='p2'>{product.price}.00$</Text>
			</Card.Body>
		</Card>
	);
};

export default Product;
